import React from "react";
import User from "../user/_index";
import Sample from "../sample/_index";
import { Route, Switch } from "react-router-dom";
import Template from "../templateType/_index";
import Project from "../projectInfo/_index";
import HeaderClassification from "../headerClassification/_index";
import { Alert } from "antd";
import I18n from "i18n-js";

class Routes extends React.Component {
  render() {
    return (
      <Switch>
        <Route
          path="/home"
          render={() => (
            <div
              style={{
                marginLeft: 25,
                marginRight: 25,
                marginTop: 25,
                paddingBottom: 20,
                paddingLeft: 50,
              }}
            >
              <Alert
                className="alert-message-style"
                message={I18n.t("message." + this.props.message)}
                type="error"
              />
            </div>
          )}
        ></Route>
        <Route path="/users" component={User}></Route>
        <Route path="/samples" component={Sample}></Route>
        <Route
          path="/header_classification_dicts"
          component={HeaderClassification}
        ></Route>
        <Route path="/writingPolicies" component={Template}></Route>
        <Route path="/projectInfos" component={Project}></Route>
        <Route path="/logout" component="Logout"></Route>
      </Switch>
    );
  }
}

export default Routes;
